const routes = createBrowserRouter([
  {
    path: '/',
    element: <Main />,
    children: [
      { index: true, element: <Home /> }
    ]
  }
])
const root = ReactDOM.createRoot
  (document.getElementById('root'));

root.render(<RouterProvider router={routes} />);
